import React from "react";
import marketingCase from "../assets/marketingCase.png";

function Pagefive() {
  return (
    <div
      style={{ display: "flex", alignItems: "center", flexDirection: "column", fontFamily:'Openn Sans' }}
    >
      <p>Our Works</p>
      <h3>Our Case Studies</h3>

      <div>
        <div style={{display:'flex', flexDirection:'column',alignItems:'center'}}>
            <img src={marketingCase} alt=""/>
            <p style={{fontWeight:'700', fontSize:'26px'}}>Email Marketing</p>
            <p style={{fontWeight:'700', fontSize:'18px'}}>Fashion, Product</p>
        </div>
      </div>
    </div>
  );
}

export default Pagefive;
